import { Injectable } from "@angular/core";
import { INumberIsOdd } from "../Services.Abstractions/INumberIsOdd";



@Injectable()
export class NumberIsOdd implements INumberIsOdd {
    public isEqual(number: number): boolean {
        return number % 2 != 0;
    }
}
